description:
One of the SWIM FAST! series, this is good stuff although not a well known video. Lindsay has been a champ since a kid and this is pretty much what she has done with her life. She is reported to be a good motivator.

All American 21 times.

National Champ 7 times.

NCAA Champ 5 times.

World Record Holder for 200 AND 400 meter (short-course - in other words has great turns)

2000 Olympics Gold Medal Winner (relay race)

Definitely does not use any elements of the Total Immersion technique.
http://thepiratebay.se/torrent/4745018/Total_Immersion_Freestyle_Made_Easy.avi

She relies a lot on power and the standard over-the-head, C-shaped arm style.

Lots of specific pointers on fine technique.

Plenty of underwater examples.

Aimed mainly at competitive swimmers,&quot;Freesytle with Lindsay Benko&quot; provides tips on:
2-beat kick
6-beat kick
stretching
streamlining
finishes
drills
practice
analysis

DVD quality is not that great so here it is in AVI because 10% of the size so more downloads faster and you can still get the point. This is not a special effects Hollywood movie.

320x240 px from the original DVD

